pragma solidity ^0.8.21;

contract Worker{

    struct Date{
        uint16 date;
        uint16 month;
        uint256 year;
    }

    struct Location{
        string street;
        string district;
        string state;
    }

    struct UserType{
        string fname;
        string lname;
        string username;
        string password;
        address walletAddress; 
        Date DoB;
    }

    mapping(uint=>address) private workersKeys;
    mapping (address=>UserType) workerData;
    uint totalWorkers;

    constructor(){
        totalWorkers = 0;
    }

    function checkIfWorker(address senderAddress) public view returns(bool){
        return workerData[senderAddress].walletAddress == senderAddress;
